this is the nginx config I use for 8x gpus, works quite well:
```
user www-data;
worker_processes auto;
pid /run/nginx.pid;
include /etc/nginx/modules-enabled/*.conf;
events {
        worker_connections 768;
}
http {
    ignore_invalid_headers off;
    client_max_body_size 0;
    log_format proxylog '$remote_addr - $remote_user upstream=$upstream_addr [$time_local] ($request_time) '
                '"$request" $status $body_bytes_sent '
                '"$http_referer" "$http_user_agent"';
    upstream wombo {
        least_conn;
        server 127.0.0.1:3050;
        server 127.0.0.1:3051;
        server 127.0.0.1:3052;
        server 127.0.0.1:3053;
        server 127.0.0.1:3054;
        server 127.0.0.1:3055;
        server 127.0.0.1:3056;
        server 127.0.0.1:3057;
    }
    server {
        access_log /var/log/nginx/access.log proxylog;
        listen 127.0.0.1:3049;
        location / {
            proxy_pass                http://wombo;
            proxy_next_upstream       error timeout invalid_header http_500 http_502;
            proxy_next_upstream_tries 4;
            proxy_connect_timeout     1;
        }
    }
}
```
Then each generator instance would have CUDA_VISIBLE_DEVICES set to 0-7 and port 3050-3057 accordingly
